import searchIcon from "./../../../images/search__icon.svg";
import searchButton from "./../../../images/find.svg";
import FilterCheckbox from "../FilterCheckbox/FilterCheckbox";

const SearchForm = () => {
  return (
    <form className="searchform">
      <div className="searchform__container">
        <div className="searchform__content">
          <div className="searchform__line">
            <img
              className="searchform__icon"
              src={searchIcon}
              alt="Поиск"
            ></img>
            <input
              className="searchform__input"
              type="search"
              placeholder="Фильм"
              required
            ></input>
          </div>
          <button className="searchform__button" type="button">
            <img
              className="searchform__button-image"
              src={searchButton}
              alt=""
            ></img>
          </button>
        </div>
        <FilterCheckbox />
      </div>
    </form>
  );
};

export default SearchForm;
